import React, { useState }from 'react'
import Logo from "../Assets/logo.png"
import { Link } from 'react-scroll';
import {FaBars, FaTimes, FaGithub, FaLinkedin} from "react-icons/fa";
import {BsFillPersonaLinesFills} from 'react-icons/bs'




function Nav() {
  const [nav, setNav] = useState(false);
  // const handleClick = () => setNav(!nav);

  const links = [
    {
      id: 1,
      link: "home",
    },
    {
      id: 2,
      link: "about",
    },
    {
      id: 3,
      link: "work",
    },
    {
      id: 4,
      link: "contact",
    },
  ];


  return (
    <div className="flex justify-between items-center w-full h-20 bg-yellow-400  fixed">
    <div>
    <img src={Logo} alt='Logo Image' style={{ width: '100px' }} />
    </div>

    <ul className="hidden md:flex">
      {links.map(({ id, link }) => (
        <li
          key={id}
          className="px-4 cursor-pointer capitalize font-medium text-gray-500 hover:scale-105 duration-200"
        >
          <Link to={link} smooth duration={500}>
            {link}
          </Link>
        </li>
      ))}
    </ul>

    <div
      onClick={() => setNav(!nav)}
      className="cursor-pointer pr-4 z-10 text-gray-500 md:hidden"
    >
      {nav ? <FaTimes size={30} /> : <FaBars size={30} />}
    </div>

    {nav && (
      <ul className="flex flex-col justify-center items-center absolute top-0 left-0 w-full h-screen bg-gradient-to-b from-black to-gray-800 text-gray-500">
        {links.map(({ id, link }) => (
          <li
            key={id}
            className="px-4 cursor-pointer capitalize py-6 text-4xl"
          >
            <Link
              onClick={() => setNav(!nav)}
              to={link}
              smooth
              duration={500}
            >
              {link}
            </Link>
          </li>
        ))}
      </ul>
    )}
    <div className="felx fixed flex-col top-[40%] right-0"> 
    <ul>
      <li className='w-[160px] h-[60px] flex justify-between mr-[-100px] hover:mr-[-10px] duration-300'>
        <a className='flex justify-between items-center w-full text-gray-400'
        href="/">
          GitHub <FaGithub size={30} />
        </a>
      </li>
      <li>
        <a href="/">
          LinkedIn <FaLinkedin size={30}  />
        </a>
      </li>
    </ul>

    </div>
  </div>
);
};
